import React from "react";
import Picture from "./sardaukar.gif";

function SardaukarElite () {
    return (
        <div id="sardaukarElite">
            <img src={Picture} alt="Sardaukar Elite" height="300" width="300"/>
        </div>
    );
}

export default SardaukarElite;
